import React from 'react';
import styled from 'styled-components';
import PersonIcon from '@material-ui/icons/Person';
import ShoppingCartIcon from '@material-ui/icons/ShoppingCart';

const Header = styled.div`
  font-size: 1.0em;
  color: white;
  background-color: black;
  height: 10vh;
`;

const Logo = styled.div`
  font-size: 1.5em;
  padding-left: 15%;
`;

const Section1 = styled.div`
  height: 90vh;
  background-image: url('.\media\banners\capa01.jpeg');
`;

const Welcome = ()=>(
  <>
    <Header className='container-fluid'>
      <header className='row pt-3'>
        <Logo className='col-8 d-flex'>
          Loja do bim
        </Logo>
        <div className='col-4 row'>
          <div className='col-6 d-flex justify-content-center pt-1'>
            <PersonIcon fontSize='medium'/>
          </div>
          <div className='col-6 d-flex justify-content-center pt-1'>
            <ShoppingCartIcon fontSize='medium'/>
          </div>
        </div>
      </header>
    </Header>
    <Section1 className='container'>
      funciona caralhooooo
    </Section1>
  </>
)

export default Welcome;
